  return (
    <nav>
      <a href="index.html">
        <img src="./src/img/Logo.svg" alt="logo" />
      </a>
      <ul class="main-nav">
        <li class="push">
          <a href="">Om Oss</a>
        </li>
      </ul>
    </nav>
  );
}

export default Start;
